How to find and edit a session with express-session and connect-mongo?<p>I use <a href="https://www.npmjs.com/package/express-session" rel="nofollow noreferrer">express-session</a> and <a href="https://www.npmjs.com/package/connect-mongo" rel="nofollow noreferrer">connect-mongo</a> to deal with user sessions.</p>

<p>I need to figure out how to search the sessions database for a specific user and update it. </p>

<p>I've tried querying the database with a fake schema and am able to find it, but when I try to save it gives an error saying the ID doesn't match, but also when I try to log the ID from the returned document, it's undefined. </p>

<p><strong>ERROR:</strong></p>

<pre><code>Cast to ObjectId failed for value "reWCaAVbumSCW9P6g2qE705Cj6jz0qpD" at path "_id" for model "sessions"
</code></pre>

<p><strong>CODE:</strong></p>

<pre><code>var mongoose = require('mongoose');
var Schema = mongoose.Schema;

const SessionSchema = new Schema({}, { strict: false });
const Session = mongoose.model('sessions', SessionSchema, 'sessions');

module.exports = function (userId, callback) {

    console.log('finding session for',userId);

    Session.findOne({session: {$regex: userId}},(err, session)=&gt;{
        if (err) return callback(err);
        if (!session) return callback('user session not found');

        //parse session
        var sessionJson = JSON.parse(session['_doc'].session);

        //add reset flag
        sessionJson.passport.user.resetSession = true;

        //save back to document
        session['_doc'].session = JSON.stringify(sessionJson);

        //save session to database
        session.save((err, savedSession)=&gt;{
            if (err) return callback(err);

            //success
            return callback(null);
        });
    });
};
</code></pre>

<p>Can anyone figure out why the _id field is having problems, or point me towards a better way of editing sessions? Note: this is not editing the session of the logged in user, but for any user. </p>

