How to use $inc operator for variables in MongoDB using Node.JS<p>I am trying to build a "number of visitors" collection in mongoDb using Node.JS backend of my website. The frontend sends the following info to Node.JS backend as JSON.</p>

<ol>
<li>isUniqueVisitor - 1 if yes, 0 if no</li>
<li>country         - standard country code  -  "JP", "IN", "UK", etc</li>
</ol>

<p>My database looks like following</p>

<pre><code>{
    "today": 2019-06-07,
    "uniqueVisitors": {
        "count": 230,
        "countries": {
            "JP": 102,
            "IN": 88,
            "UK": 30
        }
    }
}
</code></pre>

<p>It works well if I use $inc with fixed values</p>

<pre><code>Eg. $inc: {count: 1}  // for string/integers keys
Eg. $inc: {"uniqueVisitors.count": 1} // inside quotes to access key of a JSON
</code></pre>

<p><strong>Main issue:</strong>
<em>I am not able to access a document name using variable.</em></p>

<pre><code>Eg. $inc: {`uniqueVisitors.countries[${req.body.country}]`}
</code></pre>

<p>This creates an error as backticks can't be used for Mongo.
I tried with</p>

<pre><code>Eg. $inc: {uniqueVisitors["countries"][req.body.country]}
</code></pre>

<p>But even this creates error.</p>

<p>I followed the web and found that mongo $set using variables can be realized by passing the required JSON directly to $set. Hence I resorted to code it the following way. </p>

<pre><code> mongoClient.connect(mongoURL, async function (err, db) {
        if (err) throw err;
        console.log("Database connected");

            // Identifying my document with today's date
            var myQuery = {
                date: getTodayDate()
            };

            // Defining the JSON to be passed to uniqueVisitors $inc
            var uniqueVisitorsInc = {
                "uniqueVisitors": {
                    "count": 0,
                    "countries": {}
                }
            };

            // Populating the JSON to be passed to uniqueVisitors $inc =&gt; essentially asking to increase count by 1 and increase that country's count by 1

            uniqueVisitorsInc["uniqueVisitors"]["count"] = 1;
            uniqueVisitorsInc["uniqueVisitors"]["countries"][myData.country] = 1;

            var newValues = {
                $inc: uniqueVisitorsInc
            };
            await db.collection("visitorStats").update(myQuery, newValues, {upsert: true});
            db.close();
    });
</code></pre>

<blockquote>
  <p>The above method worked well on editor but threw the following runtime error:</p>
</blockquote>

<pre><code>$inc requires numerical values
</code></pre>

<p>Basically asking me to pass values to $inc in {var1: 1, var2: 5} pattern.</p>

<p>Please help me bypass this weird situation.</p>

<p>I know I can do a two step process where I read the values first, increment in variable and $set it in Mongo.</p>

<p>But does anyone know how to overcome this situation using $inc? </p>

